**ComminicationSpi**
- Channel interface added (listeners on channel events supported);
- Communication channels support additional arbitrary attributes on a handshake;
- GridIoManager can be used to create/listen to new channels; 

**FileTramsmitProcessor**
- The file download speed can be limited at runtime;
- The file can be re-uploaded from the last position if the disconnect occurs;
- The FileWrite interface to allow user upload files;
- The TransmitSession interface to handle download file events;
- FileHandler, ChunkHandler to process downloaded files if different manner;
